import React from 'react';
import Slider from 'rc-slider';
import 'rc-slider/assets/index.css';

function TestSlider() {
	const style = {
		float: 'left',
		width: 160,
		height: 400,
		marginBottom: 160,
		marginLeft: 50,
	};

	return (
		<>
			<div className='col-6' style={style}>
				<Slider
					vertical
					min={0}
					max={100}
					step={1}
					defaultValue={0}
					onChange={(value) => console.log(value)}
				/>
			</div>
		</>
	);
}

export default TestSlider;
